import Item from '../Components/Item';

import React from 'react'

function Welotto({ number }) {
    return (
        <div className="content">
            <div>
                <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fqs-smart.vn%2Fcoming-soon%2F&psig=AOvVaw1H_xXTkJfn3j6tVUTBFnJZ&ust=1645453044765000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCNDbpr28jvYCFQAAAAAdAAAAABAD" alt="img"></img>
            </div>
            <div className="container">
                <Item number={number} />
            </div>
        </div>
    )
}

export default Welotto;
